import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import Quiz from './components/Quiz';
import Landing from './components/Landing';

function Navbar() {
    return (
        <nav style={{ backgroundColor: '#121212', padding: '10px 0', textAlign: 'center' }}>
            <a href="/" style={{ margin: '0 15px', textDecoration: 'none', color: '#ffcc00' }}>
                Home
            </a>
            <a href="/register" style={{ margin: '0 15px', textDecoration: 'none', color: '#ffcc00' }}>
                Register
            </a>
            <a href="/login" style={{ margin: '0 15px', textDecoration: 'none', color: '#ffcc00' }}>
                Login
            </a>
            <a href="/quiz" style={{ margin: '0 15px', textDecoration: 'none', color: '#ffcc00' }}>
                Quiz
            </a>
        </nav>
    );
}

function App() {
    return (
        <Router>
            <div>
                <h1 className="text-center">Quiz App</h1>
                <Navbar />
                <Routes>
                    <Route path="/" element={<Landing />} />
                    <Route path="/register" element={<Register />} />
                    <Route path="/login" element={<Login />} />
                    <Route path="/quiz" element={<Quiz />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
